import { Container } from '@material-ui/core';
import React from 'react'
import styled from 'styled-components'
import { mobile } from '../Responsive';
import Navbar from '../components/Navbar';
import Announcement from '../components/Announcement';
import { Link } from 'react-router-dom';

const Constainer = styled.div``;
const Wrapper = styled.div`
padding: 20px;
${mobile({padding:"10px"})}
`;
const Title = styled.span`
  font-weight: 300;
  text-align: center;
`;
const Top = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;
`;

const Bottom = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;
  ${mobile({flexDirection:"column"})}
`;
const Info = styled.div`
  flex: 3;
`;

const Product = styled.div`
  display: flex;
  justify-content: space-between;
  ${mobile({flexDirection:'column'})}
`;
const ProductDetail = styled.div`
  flex:2;
  display: flex;
`;
const Image = styled.img`
width:100px;
margin-top:5px;
`;
const Details = styled.div`
  padding: 10px;
  display: flex;
  flex-direction: space-around;
`;

const ProductName = styled.span`
  
`;
const ProductId = styled.span`
  
`;
const ProductColor = styled.div`
  width: 20px;
  height: 20px;
  border: 1px solid gray;
  border-radius: 50%;
  background-color: ${props=>props.color};
`;
const PriceDetail = styled.div`
  flex: 1;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
`;
const ProductAmountContainer = styled.div`
  display: flex;
  align-items: center;
  margin-bottom: 20px;
`;
const ProductAmount = styled.div`
font-size: 24px;
margin: 5px;
${mobile({margin:"5px 15px"})}
`;
const ProductPrice = styled.div`
  font-size: 30px;
  font-weight: 200px;
`;
const Hr = styled.hr`
  background-color: #eee;
  border: none;
  height: 1px;
`;
const TopButton = styled.button`
  padding: 10px;
  font-weight: 600;
  cursor: pointer;
  color: white;
  background-color: blue;
  border: none;
  border-radius: 3px;
`
function Orders() {
  return (
    <Constainer>
      <Announcement/>
      <Navbar/>
      
      <Wrapper>
       
       <Top>
       <Title>My Orders</Title>
       <Link to={'/products'}>
       <TopButton>CONTINUE SHOPING</TopButton>
       </Link>
       </Top>
       <Bottom>
        <Product>
          <ProductDetail>
            <Image src='https://firebasestorage.googleapis.com/v0/b/shop-18d6e.appspot.com/o/1717535450017adults-plain-cotton-tshirt-2-pack-teal.jpg?alt=media&token=f4f8c288-20e7-4d0c-b62a-941cfd0654be'/>
            <Details>
              <ProductName><b></b></ProductName>
            </Details>
          </ProductDetail>
        </Product>
       </Bottom>
      </Wrapper>
    </Constainer>
  )
}

export default Orders
